	(90, 42, 44, 0, 'â€œI\'m selfish, impatient and a little insecure. I make mistakes, I am out of control and at times hard to handle. But if you can\'t handle me at my worst, then you sure as hell don\'t deserve me at my best.â€ - Marilyn Monroe\r', '2017-03-16 02:56:31'),
