INSERT INTO `users` (`ID`, `userName`, `passHash`, `realName`, `email`, `region`, `taste`, `userDesc`, `postCount`, `regDate`, `firstUse`, `kollajDistance`, `privateState`) VALUES
	(1, 'spacewalkingninja', '$2y$10$M.vnKz.OBGvUMBqfdeQMRe2.ogE1BG3hpmzwihFtHlXOaFTJniSTa', '      Kristian Atanasov  ', 'spacewalkingninja@gmail.com', '0', '0', '', 0, '2016-11-19 10:33:17', 1, '11', 0),
	(2, 'claudiaf_98', '73bd19070d6f60af6dcedc429a382600ba59e3b3k32duem01vZsQ2lB8g0s', 'Cláudia Ferreira', 'clauditafsf@hotmail.com', '0', '0', 'If they give you ruled paper, write the other way.', 0, '2016-11-19 18:27:23', 1, '1', 0),
	(3, 'sadas', 'ce78349089cf43ee6586ae0f05ed41108dd7272ek32duem01vZsQ2lB8g0s', '0', 'asdas@d.co', '0', '0', 'Health nuts are going to feel stupid someday, lying in hospitals dying of nothing.', 0, '2016-11-23 22:03:57', 1, '1', 0),
	(4, 'asda', '4a4a585f0f5a36822d639c5d6e3e195402ff375dk32duem01vZsQ2lB8g0s', '0', 'asdas@gmail.c', '0', '0', 'A loving person lives in a loving world. A hostile person lives in a hostile world. Everyone you meet is your mirror.', 0, '2016-11-23 22:05:21', 1, '1', 0),
	(5, 'realDealThing', 'c548f91f30a4899b0c58faabfc599d6e3a0c8161k32duem01vZsQ2lB8g0s', '0', 'realdealthing@gmail.com', '0', '0', 'That which has always been accepted by everyone, everywhere, is almost certain to be false.', 0, '2016-11-23 22:07:31', 1, '1', 0),
	(6, 'asdasd', '07ff0defc8e226acf0d84998f3ad1f24b58a65bak32duem01vZsQ2lB8g0s', '0', 'asfas@fga.c', '0', '0', 'To be pleased with one\'s limits is a wretched state.', 0, '2016-11-23 22:09:06', 1, '1', 0),
	(7, 'reasf', '81e1b058568ca9c27e46e761000254fc06ca5ae3k32duem01vZsQ2lB8g0s', '0', 'reasf@mg.com', '0', '0', 'A man cannot be too careful in the choice of his enemies.', 0, '2016-11-23 22:17:31', 1, '1', 0),
	(8, 'safa', '0a9b840f5b93660ea4b84003dc832ff438d4d0e3k32duem01vZsQ2lB8g0s', '0', 'asgg@sd.c', '0', '0', 'The world is moving so fast these days that the man who says it can\'t be done is generally interrupted by someone doing it.', 0, '2016-11-23 22:22:50', 1, '1', 0),
	(9, 'Spacewalk', '5fd4a1707e53e1cac39060364caebb6cdbd5a7bek32duem01vZsQ2lB8g0s', '0', 'Dadada@da.bf', '0', '0', 'The secret of a good memory is attention, and attention to a subject depends upon our interest in it. We rarely forget that which has made a deep impression on our minds.', 0, '2016-11-25 05:47:55', 1, '1', 0),
	(10, 'Spacewalker', 'dce4e552947e6386d4369ee773c5ffdc9b460bf5k32duem01vZsQ2lB8g0s', '0', 'Dada@d.bg', '0', '0', 'In real life, unlike in Shakespeare, the sweetness of the rose depends upon the name it bears. Things are not only what they are. They are, in very important respects, what they seem to be.', 0, '2016-11-25 05:49:59', 1, '1', 0),
	(11, 'Spacewalker2', 'dce4e552947e6386d4369ee773c5ffdc9b460bf5k32duem01vZsQ2lB8g0s', '0', '', '0', '0', 'There are a terrible lot of lies going around the world, and the worst of it is half of them are true.', 0, '2016-11-25 05:53:14', 1, '1', 0),
	(12, 'Teet', '555f6fde19198bfa9b177e5683fa6aee0f697f45k32duem01vZsQ2lB8g0s', '0', 'Tttttt@ttt.co', '0', '0', '\'Whom are you?\' he asked, for he had attended business college.', 0, '2016-11-25 05:56:49', 1, '1', 0),
	(13, 'Oleg', 'b8fc1bafb18a8d52a948d1ac19aa17dbf61dbd54k32duem01vZsQ2lB8g0s', 'Oleg Atanasov', 'Robin4o.hood@gmail com', '0', '0', 'You will need to find your passion. Don\'t give up on finding it because then all you\'re doing is waiting for the Reaper.', 0, '2016-11-25 17:49:04', 1, '1', 0),
	(14, 'Oleg atanasov', 'b8fc1bafb18a8d52a948d1ac19aa17dbf61dbd54k32duem01vZsQ2lB8g0s', '0', 'Robin4o.hood@gmail.com', '0', '0', 'I have come to the conclusion that politics are too serious a matter to be left to the politicians.', 0, '2016-12-16 21:22:26', 1, '1', 0),
	(15, '', 'myTestingPass', '0', 'test@test.com', '0', '0', 'There’s so much comedy on television. Does that cause comedy in the streets?', 0, '2017-01-27 00:41:17', 1, '1', 0),
	(16, 'aHacker', '137658137', '0', 'thisIs@nsa.gov', '0', '0', 'Without discipline, there\'s no life at all.', 0, '2017-01-27 00:46:35', 1, '1', 0),
	(17, 'IMTHETEST', '192712', '0', 'tester@imTest.com', '0', '0', 'Never deprive someone of hope; it might be all they have.', 0, '2017-01-27 16:54:27', 1, '1', 0),
	(18, 'sadas352', 'dasdas', '0', 'testinga@asd.co', '0', '0', 'Nobody believes the official spokesman... but everybody trusts an unidentified source.', 0, '2017-01-27 16:55:53', 1, '1', 0),
	(19, 'aoisuf', '398502', '0', 'asdasf3@sk.co', '0', '0', 'I\'m a jerk to everyone. Best way to protect yourself from lawsuits.', 0, '2017-01-27 16:57:01', 1, '1', 0),
	(20, 'jafsilva4', '1234567890', 'João Silva', 'joaosilva4_@hotmail.com', '0', '0', '&', 0, '2017-01-27 17:32:52', 1, '32', 0),
	(21, 'Gothqueen', 'kalash', 'Bia França', 'biafranca.16.09.96@gmail.com', '0', '0', 'But the worst of imagining things is that the time comes when you have to stop and that hurts.', 0, '2017-01-31 16:44:55', 1, '5', 0),
	(23, 'carlitos', '123456', 'Carlos Correia', 'carlos.curado.10@gmail.com', '0', '0', 'We do not need magic to transform our world. We carry all the power we need inside ourselves already. We have the power to imagine better.', 0, '2017-02-03 22:31:36', 1, '1', 0),
	(24, 'testing', '123456', '0', 'tester@askd.ago', '0', '0', 'To be always fortunate, and to pass through life with a soul that has never known sorrow, is to be ignorant of one half of nature.', 0, '2017-02-03 22:34:56', 1, '1', 0),
	(25, 'testerA', '123456', '0', 'testing@sf.com', '0', '0', 'Honest criticism is hard to take, particularly from a relative, a friend, an acquaintance, or a stranger.', 0, '2017-02-03 22:39:08', 1, '1', 0),
